import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { useNavigate, useParams } from 'react-router-dom';
import '../CSS folder/style.css'


export default function Dashboard() {

  let navigateTo = useNavigate();

  const { email } = useParams();

  const [student, setStudent] = useState({
    name: "",
    email: "",
    password: ""
  });

  // const getStudentDetails = async () => {

  //   // e.preventDefault();
  //   await axios.get('http://localhost:4000/getAllStudents')
  //     .then((result) => {
  //       console.log("fetched student details", result.data);
  //       setStudent(result.data);
  //     });
  // }

  const getStudentDetails = async () => {

    // e.preventDefault();
    await axios.get(`http://localhost:4000/getStudentByEmail/${email}`)
      .then((result) => {
        console.log("fetched student details", result.data);
        setStudent(result.data);
      });
  }

  useEffect(() => {
    getStudentDetails();
  }, []);

  const handleLogout = () => {
    // e.preventDefault();
    setStudent([]);
    navigateTo('/');
  };

  return (
    <>
      <div className="wrapper">
        <div className="inner">
          <form>
            <h3> !!Welcome Student!! </h3>
            <p><b>This is Landing page for Student</b></p>
            <div className='land'>
              <center>
                {student.map((stud, index) => (

                  <tr>
                    <th scope="row" key={index}>{index + 1}</th>
                    {/* <th scope="row" >{user.id}</th> */}
                    <td>{stud.name}</td>
                    <td>{stud.username}</td>
                    <td>{stud.email}</td>
                  </tr>
                ))}
              </center>
            </div>
            <button onClick={handleLogout}>Logout</button>
          </form>
        </div>
      </div>
    </>

  )
}
